import React from 'react';

const Home = () => {
    return (
        <div>
      <div class="jumbotron">
        <p class="lead">This is an Amaxing place to create memories in terms of Blogs!</p>
        <p class="lead">
          This is the one stop place if you love reading, writing Blogs..
        </p>

      </div>
    </div>
    );
};

export default Home;
